t_019_many_to_many.llm_output:
use spacetimedb::{table, reducer, ReducerContext, Table};

#[table(name = user)]
pub struct User {
    #[primary_key]
    user_id: i32,
    name: String,
}

#[table(name = group)]
pub struct Group {
    #[primary_key]
    group_id: i32,
    title: String,
}

#[table(
    name = membership,
    index(name = by_user, btree(columns = [user_id])),
    index(name = by_group, btree(columns = [group_id]))
)]
pub struct Membership {
    #[primary_key]
    id: i32,
    user_id: i32,
    group_id: i32,
}

#[reducer]
fn seed(ctx: &ReducerContext) {
    // Clear existing rows to ensure the tables contain exactly the specified rows.
    {
        let ids: Vec<i32> = ctx.db.membership().iter().map(|r| r.id).collect();
        for id in ids {
            ctx.db.membership().id().delete(&id);
        }
    }
    {
        let ids: Vec<i32> = ctx.db.user().iter().map(|r| r.user_id).collect();
        for id in ids {
            ctx.db.user().user_id().delete(&id);
        }
    }
    {
        let ids: Vec<i32> = ctx.db.group().iter().map(|r| r.group_id).collect();
        for id in ids {
            ctx.db.group().group_id().delete(&id);
        }
    }

    // Insert users
    ctx.db.user().insert(User { user_id: 1, name: "Alice".to_string() });
    ctx.db.user().insert(User { user_id: 2, name: "Bob".to_string() });

    // Insert groups
    ctx.db.group().insert(Group { group_id: 10, title: "Admin".to_string() });
    ctx.db.group().insert(Group { group_id: 20, title: "Dev".to_string() });

    // Insert memberships
    ctx.db.membership().insert(Membership { id: 1, user_id: 1, group_id: 10 });
    ctx.db.membership().insert(Membership { id: 2, user_id: 1, group_id: 20 });
    ctx.db.membership().insert(Membership { id: 3, user_id: 2, group_id: 20 });
}

t_020_ecs.llm_output:
use spacetimedb::{table, reducer, ReducerContext, Table};

#[table(name = entity)]
pub struct Entity {
    #[primary_key]
    id: i32,
}

#[table(name = position)]
pub struct Position {
    #[primary_key]
    entity_id: i32,
    x: i32,
    y: i32,
}

#[table(name = velocity)]
pub struct Velocity {
    #[primary_key]
    entity_id: i32,
    vx: i32,
    vy: i32,
}

#[table(name = next_position)]
pub struct NextPosition {
    #[primary_key]
    entity_id: i32,
    x: i32,
    y: i32,
}

#[reducer]
pub fn seed(ctx: &ReducerContext) {
    ctx.db.entity().insert(Entity { id: 1 });
    ctx.db.position().insert(Position { entity_id: 1, x: 0, y: 0 });
    ctx.db.velocity().insert(Velocity { entity_id: 1, vx: 1, vy: 0 });

    ctx.db.entity().insert(Entity { id: 2 });
    ctx.db.position().insert(Position { entity_id: 2, x: 10, y: 0 });
    ctx.db.velocity().insert(Velocity { entity_id: 2, vx: -2, vy: 3 });
}

#[reducer]
pub fn step(ctx: &ReducerContext) {
    let pos_table = ctx.db.position();
    let vel_by_eid = ctx.db.velocity().entity_id();
    let next_table = ctx.db.next_position();
    let next_by_eid = next_table.entity_id();

    for pos in pos_table.iter() {
        if let Some(vel) = vel_by_eid.find(pos.entity_id) {
            let np = NextPosition {
                entity_id: pos.entity_id,
                x: pos.x + vel.vx,
                y: pos.y + vel.vy,
            };
            if next_by_eid.find(pos.entity_id).is_some() {
                next_by_eid.update(np);
            } else {
                next_table.insert(np);
            }
        }
    }
}

